import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state={
      string : 'Hello to React'
    };
  }

  render(){
    return(
      <div className='App'>
        <header className='App-header'>
          <p>{this.state.string}</p>
          <button>Change Text</button>
        </header>
      </div>
    );
  }
}




export default App;
